import React from 'react'
import { Card, Container, Row, Col } from 'react-bootstrap'

class Home extends React.Component {
    render() {
        let eventos = [
            {
                "nombre": "Evento 1",
                "ciudad": "Ciudad 1",
                "descripción": "Descripción 1"
            },
            {
                "nombre": "Evento 2",
                "ciudad": "Ciudad 2",
                "descripción": "Descripción 2"
            },
            {
                "nombre": "Evento 3",
                "ciudad": "Ciudad 3",
                "descripción": "Descripción 3"
            },
            {
                "nombre": "Evento 4",
                "ciudad": "Ciudad 4",
                "descripción": "Descripción 4"
            },
            {
                "nombre": "Evento 5",
                "ciudad": "Ciudad 5",
                "descripción": "Descripción 5"
            },
            {
                "nombre": "Evento 6",
                "ciudad": "Ciudad 6",
                "descripción": "Descripción 6"
            }
        ];
        return (
            <Container className='home'>
                <div style={{ marginBottom: 40}}>
                    <form>
                        <input type='text'></input>
                        <button type='submit'>Buscar</button>
                    </form>
                </div>
                <div className='eventos'>
                    <Row xl={3} l={3} md={2} s={2} xs={1}>
                        {eventos.map((value, index) => {
                            return (
                                <a href='/evento/'>
                                    <Col style={{ marginBottom: 40 }}>
                                        <Card key={index}>
                                            <Card.Img variant="top" src="holder.js/100px160"/>
                                            <Card.Body>
                                                <Card.Title><h4>{value.nombre}</h4></Card.Title>
                                                <Card.Text>
                                                    <span className='tituloCiudad'>{value.ciudad}</span><br/>
                                                    {value.descripción}
                                                </Card.Text>
                                            </Card.Body>
                                        </Card>
                                    </Col>
                                </a>
                            )
                        })}
                    </Row>
                </div>
            </Container>
        )
    }
}
export default Home;
